import React from 'react';
import ContactItem from '../Components/ContactItems';
import phone from '../img/phone.svg';
import email from '../img/emailme.svg';
import location from '../img/location.svg';

function ContactPage() {
    return (
        <div>
            <div className="map-sect">

            </div>
            <div className="contact-sect">
                <ContactItem icon={phone} text1={'+257 7756110718'} text2={'+0333 678 8792'} title={'Phone'} />
                <ContactItem icon={email} text1={'+257 7756110718'} text2={'+0333 678 8792'} title={'Email'} />
                <ContactItem icon={location} text1={'+257 7756110718'} text2={'+0333 678 8792'} title={'Address'} />
            </div>
        </div>
    )
}

export default ContactPage
